import React from 'react'
import { generateDataMap, IMapData } from 'src/constants/dataMap'

interface IMap {
	dataMapZones: IMapData
	defaultMapColor: string
	isCategoryMap?: boolean
	legend: {
		name: string
		color: string
	}[]
}

